import { StyleSheet,View,Button,TextInput,Text,TouchableOpacity,Image } from "react-native";
import React, { useState } from 'react';
export default function Estoque(){

    const [count,setCount] = useState(0);
    const [count2,setCount2] = useState(0);
    const [count3,setCount3] = useState(0);
    const [count4,setCount4] = useState(0);

    const onClickUp = () => {
        setCount(count+1)
    }

    const onClickDown = () => {
        if (count >0 ){
            setCount(count-1)
        }
    }

    const onClickUp2 = () => {
        setCount2(count2+1)
    }

    const onClickDown2 = () => {
        if (count2 >0 ){
            setCount2(count2-1)
        }
    }

    const onClickUp3 = () => {
        setCount3(count3+1)
    }

    const onClickDown3 = () => {
        if (count3 >0 ){
            setCount3(count3-1)
        }
    }

    const onClickUp4 = () => {
        setCount4(count4+1)
    }

    const onClickDown4 = () => {
        if (count4 >0 ){
            setCount4(count4-1)
        }
    }
    return(

            <View >
             <Image source={{uri:'data:image/jpeg;base64,'}} style={{width: 100, height: 100}} />
            <View style={styles.cabeca}>
            <Text>{count}</Text>
            </View>
            <View style={styles.arruma}>
            <TouchableOpacity onPress={onClickUp}>
            +
            </TouchableOpacity>

            <TouchableOpacity onPress={onClickDown}>
            -
            </TouchableOpacity>

            </View>
            <Image source={{uri:'data:image/jpeg;base64,'}} style={{width: 100, height: 100}} />
            <View style={styles.cabeca}>
            <Text>{count2}</Text>
            </View>
            <View style={styles.arruma}>
            <TouchableOpacity onPress={onClickUp2}>
            +
            </TouchableOpacity>

            <TouchableOpacity onPress={onClickDown2}>
            -
            </TouchableOpacity>
            </View>
            <Image source={{uri:'data:image/jpeg;base64,'}} style={{width: 100, height: 100}} />
            <View style={styles.cabeca}>
            <Text>{count3}</Text>
            </View>
            <View style={styles.arruma}>
            <TouchableOpacity onPress={onClickUp3}>
            +
            </TouchableOpacity>

            <TouchableOpacity onPress={onClickDown3}>
            -
            </TouchableOpacity>
            </View>
            <Image source={{uri:'data:image/jpeg;base64,'}} style={{width: 100, height: 100}} />
            <View style={styles.cabeca}>
            <Text>{count4}</Text>
            </View>
            <View style={styles.arruma}>
            <TouchableOpacity onPress={onClickUp4}>
            +
            </TouchableOpacity>

            <TouchableOpacity onPress={onClickDown4}>
            -
            </TouchableOpacity>
            </View>
        </View>
    )



}

const styles = StyleSheet.create({
    arruma: {
      flexDirection:'row',
      justifyContent:'space-between',
      width:'100px'
    },
    cabeca:{
        
        alignContent:'center'
    }
  });
  